  "source": "pragma solidity ^0.4.18;\n\ncontract LevelUp{\n\n\tuint tokenPrice;\n\tuint public balanceTokens;\n\tuint public totalTokensIssued;\n\tuint public totalTokensReceived;\n\n\tstruct BuyerAddress{\n\t\tstring street;\n\t\tstring state;\n\t\tstring city;\n\t\tstring pincode;\n\t\tstring phone;\n\t}\n\tstruct Order{\n\t\tuint id;\n\t\tuint productId;\n\t\tuint orderAmount;\n\t\tstring userId;\n\t\tBuyerAddress userAddress;\n\t}\n\tstruct Product{\n\t\tuint id;\n                string name;\n                string category;\n                string imageLink;\n                string descLink;\n\t\tuint price;\n\t}\n\tstruct Buyer{\n                string userId;\n                uint tokens;\n        }\n\n\tmapping(string => Buyer) buyerInfo;\n\t\n\tuint public productIndex;\n\n\tuint public orderIndex;\n\n        mapping(string => mapping(uint => Product)) stores;\n        mapping(uint => string) productIdInStore;\n\tmapping(string => Order[]) buyerOrders;\t\n\n\tfunction LevelUp(uint priceToken) public{\n\t\ttokenPrice = priceToken;\n\t}\n\n\tevent NewProduct(string _storeId, uint _productId, string _name, string _category, string _imageLink, string _descLink, uint _price);\n\n\tevent NewOrder(uint _orderId, uint _productId, string _userId, string street, string state, string city, string pincode, string phone);\n\n        function addProductToStore(string _storeId, string _name, string _category, string _image, string _desc, uint _price) public {\n                productIndex+=1;\n\n                Product memory product = Product(productIndex, _name, _category, _image, _desc, _price);\n\n                stores[_storeId][productIndex]=product;\n                productIdInStore[productIndex]=_storeId;\n\n                NewProduct(_storeId, productIndex, _name, _category, _image, _desc, _price);\n        }\n\n\n\tfunction getBuyerNumberOfOrders(string to) view public returns (uint)\n\t{\n\t\treturn buyerOrders[to].length;\n\t}\n\n\n\tfunction getBuyerTokens(string _userId) view public returns(uint)\n\t{\n\t\tBuyer memory buyer = buyerInfo[_userId];\n\t\treturn buyer.tokens;\n\t}\n\n\tfunction buyProduct(string _userId, uint _productId, uint _token, string _street, string _state, string _city, string _pincode, string _phone) public\n\t{\n\t\tProduct memory product = stores[productIdInStore[_productId]][_productId];\n\t\tBuyer memory user = buyerInfo[_userId];\n\n\n\t\trequire(_token == product.price);\n\n\t\trequire(user.tokens >= _token);\n\t\n\t\torderIndex += 1;\n\t\t\n\t\tbuyerInfo[_userId].tokens -= _token;\n\n\t\tBuyerAddress memory userAddress = BuyerAddress(_street, _state, _city, _pincode, _phone); \n\t\tOrder memory order = Order(orderIndex, _productId, _token, _userId, userAddress);\n\n\t\tbuyerOrders[_userId].push(order);\n\t\tbalanceTokens -= _token;\n\t\ttotalTokensReceived += _token;\t\t\n\n\t\tNewOrder(orderIndex, _productId, _userId, _street, _state, _city, _pincode, _phone);\t\t\t\t\t\n\t}\n\n\tfunction giveLevelUpTokens(string _userId) payable public returns(uint)\n        {\n\t\tuint token = msg.value/tokenPrice;\n\n\t\tbuyerInfo[_userId].userId = _userId;\n\t\tbuyerInfo[_userId].tokens += token;\n        \tbalanceTokens += token;\n\t        totalTokensIssued += token;\n\n\t\treturn buyerInfo[_userId].tokens;\n\t\n        }\n\n}\n",
